import React from "react";
import "./AboutUs.css"

function AboutUs() {
    return (
        <div>
            <p className="about">About us </p>
            <p>
                The Government of Maharashtra with the aim and vision to spread Technical Education in rural and tribal areas of the state of
                Maharashtra founded Government College Of Engineering, Karad in 1960. The College is affiliated to Shivaji University, Kolhapur
                and is acting as a vital education center for many years.
                Over the years the college has produced about 7200 engineers and more than 300 computer professionals through Master of Computer
                Application course which is unique in  Engineering faculty under Shivaji University. Along with the degree courses in Civil,
                Mechanical, Electrical and Information Technology, the college also offers programs in different specializations in Civil, Mechanical
                and Electrical Engineering. Vision of the Institute "To emerge as a Technical- Institution of National repute driven
                by excellence in imparting value based education and innovation in research, to face the global needs of the profession."
            </p>
        </div>
    );
}
export default AboutUs;
